-- INSERT INTO `familia_vegetals_translation` (`id`, `nom`, `descripcio`, `lang`, `slug`) VALUES (1,'Umbrel·líferes','Són plantes molt conegudes com a condiments o pels seus valors medicinals. \r\nTenen nombroses i diminutes flors agrupades en tiges radials en forma d\'ombrel·la.\r\nLes seves llavors germinen amb gran lentitud.\r\n','ca','umbrel-liferes'),(1,'Umbreliferes','?','en','umbreliferes'),(1,'Umbrelíferas','?','es','umbreliferas'),(2,'Liliàcies','Està formada majoritàriament per herbes proveïdes de bulbs, rizomes o tubercles. especialment útils en els llocs on aquestes plantes més abunden per la seva capacitat de regeneració davant de situacions adeverses, com el foc o la sequera.\r\n','ca','liliacies'),(2,'Liliacieds','?','en','liliacieds'),(2,'Liliácias','?','es','liliacias'),(3,'Labiades','Són fonamentalment herbes i arbustus, molt aromàtiques per la presència de glàndules amb olis essencials, responsables de les aromes que els caracteritzen i riques en principis actius. \r\nSón molt estimades en medicina natural i farmacopea.\r\n','ca','labiades'),(3,'Labiads','?','en','labiads'),(3,'Labiadas','?','es','labiadas'),(4,'Solanàcies','Comprèn espècies ombrívoles i tropicals. la majoria de les solanàcies comestibles procedeixen d\'Amèrica central i meridional pel que requereixen un sòl molt ric, humit i fèrtil\r\n\r\n','ca','solanacies'),(4,'Solanacieds','?','en','solanacieds'),(4,'Solanácias','?','es','solanacias'),(5,'Convolvulàcies','És una família de arbusts i arbres, moltes d\'elles enfiladisses. Algunes especies de origen americà es conrean a molts llocs del món pels seus tubercles.\r\n','ca','convolvulacies'),(5,'Convolvulaciades','?','en','convolvulaciades'),(5,'Convolvulácias','?','es','convolvulacias'),(6,'Cucurbitàcies','Està àmpliament representada, tant per espècies silvestres com conreades, les quins constitueixen una part important de la dieta bàsica. Són plantes enfiladisses anuals que tenen un gran valor pels seus voluminosos fruits comestibles\r\n','ca','cucurbitacies'),(6,'Cucurbitacieds','?','en','cucurbitacieds'),(6,'Cucurbitácias','?','es','cucurbitacias'),(7,'Lleguminoses','Moltes espècies d\'aquesta família tenen gran importància com aliment humà, proporcionen proteïnes. Tenen la capacitat de fixar nitrogen en els nòduls de les seves arrels.\r\nTotes les plantes de la família fabaceae tenen 5 pètals i l\'ovari forma una beina o llegum.','ca','lleguminoses'),(7,'Leguminoses','?','en','leguminoses'),(7,'Leguminosas','?','es','leguminosas'),(8,'Gramínies','AÉs una família cosmopolita, que ha conquistat la majoria dels nínxols ecològics del planeta.\r\nConstitueixen la font d\'alimentació animal bàsica i humana.\r\nPresenten una estructura floral molt característica, agrupant-se les flors en espiguillas!!!!\r\n','ca','graminies'),(8,'Graminieds','?','en','graminieds'),(8,'Gramínias','?','es','graminias'),(9,'Valerianàcies','Les plantes de la família són generalment herbàcies i amb unes fulles amb olor desagradable. Algunes espècies són cultivades com ornamentals i d\'altres són medicinals per induir la relaxació i la son.','ca','valerianacies'),(9,'Valerianacieds','?','en','valerianacieds'),(9,'Valerianácias','?','es','valerianacias'),(10,'Quenopodiàcies','Procedeixen de zones costaneres, per aquest motiu les fulles estan cobertes amb una capa de cutina que els permet mantenir la humitat.\r\nProdueixen les seves llavors dins de petits fruits que es mantenen intactes fins a germinar en el sòl, raó per la qual les plantes sorgeixen agrupades en massissos.\r\n','ca','quenopodiacies'),(10,'Quenopodiacieds','?','en','quenopodiacieds'),(10,'Quenopodiácias','?','es','quenopodiacias'),(11,'Compostes','Inclou moltes espècies conreades. Les flors són cúmuls de nombroses floretas de tal manera que semblen una. \r\nAquesta família comprèn dos grups importants, el de les amanides: són plantes de desenvolupament ràpid i tija tova i el dels cards: en general necessiten una cocció\r\n','ca','compostes'),(11,'Composted','?','en','composted'),(11,'Compuestas','?','es','compuestas'),(12,'Crucíferes','Força crucíferes són conreades perquè són comestibles. Necessiten molt poca aigua i estan adaptades per emmagatzemar l\'aigua que reben.\r\nSón biennals, emmagatzemen aliments durant el primer any de vida i en el segon floreixen t donen llavors.\r\n\r\n\r\n','ca','cruciferes'),(12,'Crucifereds','?','en','crucifereds'),(12,'Crucíferas','?','es','cruciferas');
